import React from "react";
import { Navbar } from "..";
import "./Header.css"
function Header(){

    return(
        <section classname="header">
            <section classname="logo">
                <a href="/" classname="headerlogo">LOGO</a>
            </section>
            <section className="Navbar">
                <Navbar/>
            </section>

        </section>
    )
}
export default Header;
